import React from 'react';
import styled from 'styled-components';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container'
import {CustomJumbotron} from './components/CustomJumbotron';
import {Footer} from './components/Footer';
import {CustomCard} from './components/CustomCard';
import BackgroundImage from './assets/background.png';

const Styles = styled.div`
    .row {
        margin-left: 0px;
        margin-right: 0px;
        font-family: 'Montserrat', sans-serif;
    }

    .col {
        text-align: center;
    }
`;


export const News = () => {
    return (
        <Styles>
            <CustomJumbotron>News</CustomJumbotron>
            <div style = {{ backgroundColor: '#cfcfcf'}}>
                <Container style = {{paddingTop: 30, paddingBottom: 70}} >
                    <Row>
                        <CustomCard subTitle = 'Forbes' 
                                    title = 'Next-Gen Educational Tools Deliver A Big Dose Of Fun'
                                    image = {BackgroundImage}>
                        </CustomCard>
                        <CustomCard subTitle = 'www.huffingtonpost.com' 
                                    title = 'March MATHness Training'
                                    image = {BackgroundImage}>
                        </CustomCard>
                        <CustomCard subTitle = 'The Atlantic' 
                                    title = 'The Math Revolution'
                                    image = {BackgroundImage}>The Math Revolution
                        </CustomCard>
                        <CustomCard subTitle = 'Ed Surge' 
                                    title = 'The Math Revolution'
                                    image = {BackgroundImage}>
                        </CustomCard>
                    </Row>
                </Container>
            </div>
            <Footer></Footer>
        </Styles>
    );
}
